import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import BerichtenPagina from './Berichten/BerichtenPagina';
import ChatPage from './Berichten/ChatPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/berichten" element={<BerichtenPagina />} />
        <Route path="/berichten/:messageId" element={<ChatPage />} /> {/* Dynamic path for chat */}
      </Routes>
    </Router>
  );
}

export default App;
